import React from 'react';

const Proficiencies = () => {
  return (
    <section id="proficiencies" className="section proficiencies">
      <h1>Proficiencies</h1>
      <ul>
        <li>Python (PyTorch, TensorFlow, Keras)</li>
        <li>AWS (S3, Athena, Redshift)</li>
        <li>Docker, Kubernetes</li>
        <li>ReactJS, NextJS</li>
        <li>SQL, MongoDB</li>
      </ul>
    </section>
  );
}

export default Proficiencies;
